import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
   // eslint-disable-next-line no-undef
   function scrollCheck(event){
    const target = event.target
    const bottom = event.target.scrollHeight - event.target.scrollTop === 
      event.target.clientHeight;
    console.log(target)
    if (bottom) {
      console.log("At The Bottom"); //Add in what you want here
    }
  }


  return (
    <Container className="App" onScroll={this.scrollCheck}>
      <Search />
      <Cards />
      <div></div>
    </Container>
  );
}

export default App;
